一个源文件按顺序包含版权、package、import、顶层元素，且用空行分隔。 【正例】 // 第一部分，版权信息
/* * Copyright (c) Huawei Technologies Co., Ltd. 2020-2020. All rights reserved. */ // 第二部分，package 声明
package com.huawei.myproduct.mymodule // 第三部分，import 声明
from std import collection.HashMap // 标准库 // 第四部分，public 元素定义
public class ListItem <: Component { // ...
} // 第五部分，internal 元素定义
class Helper { // CODE
} 说明： 仓颉格式化工具不会强制用空行将版权信息部分与其他部分分隔，若开发者在版权信息下方留有一个或多个空行，则格式化工具会保留一个空行。 采用一致的空格缩进，每次缩进 4 个空格。 【正例】 class ListItem { var content: Array<Int64> // 符合：相对类声明缩进 4 个空格 init( content: Array<Int64>, // 符合：函数参数相对函数声明缩进 4 个空格 isShow!: Bool = true, id!: String = "" ) { this.content = content }
} 使用统一的大括号换行风格，对于非空块状结构，大括号使用 K&R 风格。 【正例】 enum TimeUnit { // 符合：跟随声明放行末，前置 1 空格 Year | Month | Day | Hour
} // 符合：右大括号独占一行 class A { // 符合：跟随声明放行末，前置 1 空格 var count = 1
} func fn(a: Int64): Unit { // 符合：跟随声明放行末，前置 1 空格 if (a > 0) { // 符合：跟随声明放行末，前置 1 空格 // CODE } else { // 符合：右大括号和 else 在同一行 // CODE } // 符合：右大括号独占一行
} // lambda 函数
let add = { base: Int64, bonus: Int64 => // 符合: lambda 表达式中非空块遵循 K&R 风格 print("符合 news") base + bonus
} 按照仓颉语言编程规范中的规则 G.FMT.10，使用空格突出关键字和重要信息。 【正例】 var isPresent: Bool = false // 符合：变量声明冒号之后有一个空格
func method(isEmpty!: Bool): RetType { ... } // 符合：函数定义（命名参数 / 返回类型）中的冒号之后有一个空格 method(isEmpty: isPresent) // 符合: 命名参数传值中的冒号之后有一个空格 0..MAX_COUNT : -1 // 符合: range 操作符区间前后没有空格，步长冒号前后两侧有一个空格 var hundred = 0
do { // 符合：关键字 do 和后面的括号之间有一个空格 hundred++
} while (hundred < 100) // 符合：关键字 while 和前面的括号之间有一个空格 func fn(paramName1: ArgType, paramName2: ArgType): ReturnType { // 符合：圆括号和内部相邻字符之间不出现空格 ... for (i in 1..4) { // 符合：range 操作符左右两侧不留空格 ... }
} let listOne: Array<Int64> = [1, 2, 3, 4] // 符合：方括号和圆括号内部两侧不出现空格 let salary = base + bonus // 符合：二元操作符左右两侧留空格 x++ // 符合：一元操作符和操作数之间不留空格 减少不必要的空行，保持代码紧凑。 【反例】 class MyApp <: App { let album = albumCreate() let page: Router // 空行 // 空行 // 空行 init() { // 不符合：类型定义内部使用连续空行 this.page = Router("album", album) } override func onCreate(): Unit { println( "album Init." ) // 不符合：大括号内部首尾存在空行 }
} 按照仓颉语言编程规范中的规则 G.FMT.12 规定的优先级排列修饰符关键字。 以下是推荐的顶层元素的修饰符排列优先级： public
open/abstract 以下是推荐的实例成员函数或实例成员属性的修饰符排序优先级： public/protected/private
