部分代码不会记录到行覆盖率数据中，属于正常情况。整体而言，如果一行代码 仅包含定义、声明 而没有实际的可执行代码，那么这一行代码不会被统计到覆盖率中。目前已知不会统计的场景有： 全局变量的定义 ，示例如下： let HIGH_1_UInt8: UInt8 = 0b10000000; 成员变量仅声明未初始化赋值 ，示例如下： public class StringBuilder <: Collection & ToString { private var myData: Array private var mySize: Int64 private var endIndex: Int64
} 仅有函数声明未包含函数体（包括 foreign 函数等），示例如下： foreign func cj_core_free(p: CPointer): Unit 枚举类型定义 ，示例如下： enum Numeric { NumDay | NumYearDay | NumYearWeek | NumHour12 | NumHour24 | NumMinute | NumSecond
} class、extend 等定义，其中 extend 和 class 所在的一行不会记录到覆盖率数据中，示例如下： extend Int8 <: Formatter { // This line wil not account for the coverage. ...
} public class StringBuilder <: Collection & ToString { // This line will not account for the coverage. ...
}

