说明： 如果您是第一次使用 VSCode 调试功能，可以查看 VSCode 调试服务使用手册 https://code.visualstudio.com/docs/editor/debugging 。 调试服务当前支持 Windows 和 Linux 版本的 VSCode 中安装使用。 受调试器限制，循环代码中存在条件断点时，执行 PAUSE 操作可能导致后续调试无法进行。 VARIABLES 视图修改变量时，不会触发存在依赖关系的变量的刷新。 调试服务依赖仓颉 SDK 包内 liblldb 动态库文件，请提前配置仓颉 SDK 路径。SDK 配置方式请参考本手册 ”安装说明“ 目录下 ”插件安装与环境配置“。 启动调试 Launch 说明： 创建仓颉工程请参考本手册 ”工程管理“ 模块介绍。 launch 模式仓颉工程调试 未创建 launch.json 文件时，点击 "Run and Debug" > "Cangjie(cjdb) Debug" 启动调试。 已创建 launch.json 文件时，在 launch.json 文件中点击 "Add Configuration..." > "Cangjie Debug (CJNative) : launch" > "Build And Debug Cangjie Project" 添加调试配置，选择添加的配置启动调试。 launch 模式单文件调试 针对单文件调试，可以选中需要调试的仓颉源文件，右键选择 “Cangjie: Build and Debug File” ，该操作会生成编译配置文件 task.json 和编译脚本，并且会根据 task.json 配置执行脚本，编译出可调试的二进制文件，然后启动调试。 start launch 模式调试手动编译的可执行文件 使用 cjc 编译器或 cjpm 手动编译出可调试的二进制文件。 点击 "Run and Debug" > "Cangjie(cjdb) Debug" > "Cangjie (CJNative): launch" > "Choose Executable File Later" 启动调试。 launch debugMacro 模式仓颉工程调试宏展开后的代码 调试宏展开后的代码文件（.marcocall为后缀的文件），此时宏对应的原文件无法调试。 launch 模式调试远程进程（支持 Linux 远程到 Linux） launch 模式下调试远程进程时，调试服务会将本地编译的二进制文件推送到远程平台，然后调试远程平台的二进制文件。 在远程平台启动 lldb-server（lldb-server 建议使用 cjdb 自带 lldb-server，路径/cangjie/third_party/llvm/lldb/bin/lldb-server）,启动命令 /**/**/cangjie/third_party/llvm/lldb/bin/lldb-server p --listen "*:1234" --server 在本地机器使用 cjc 编译器或 cjpm 手动编译出可调试的二进制文件。 单击 "Run and Debug" 按钮启动调试。 launch.json 配置示例 { "name": "Cangjie Debug (cjdb): test", "program": "/**/**/test", "request": "launch", "type": "cangjieDebug", "externalConsole": false, "remote": true, "remoteCangjieSdkPath": "/**/**/cangjie", "remoteFilePath": "/**/**/test", "remoteAddress": "1.1.1.1:1234", "remotePlatform": "remote-linux"
