} cjpm 针对一系列命令支持使用构建脚本定义命令前后行为。例如，针对 build 命令，可在 main 函数中的 match 内定义 pre-build，执行想要在 build 命令执行前需要执行的功能函数 stagePreBuild（功能函数的命名不做要求）。build 命令后的行为可以以相同的方式通过添加 post-build 的 case 选项定义。针对其他命令的命令前后行为的定义类似，只需要添加相应的 pre/post 选项和对应的功能函数即可。 在定义某一命令前后的行为后，cjpm 在执行该命令时会首先编译 build.cj，并在执行前后执行对应的行为。同样以 build 为例，在定义了 pre-build 和 post-build 后运行 cjpm build，则会按照如下步骤运行整个 cjpm build 流程： 进行编译流程前，首先编译 build.cj； 执行 pre-build 对应的功能函数； 进行 cjpm build 编译流程； 编译流程顺利结束后，cjpm 会执行 post-build 对应的功能函数。 构建脚本支持的命令如下： build, test：同时支持执行依赖模块构建脚本中定义的 pre 和 post 流程 run, install：仅支持运行对应模块的 pre 和 post 构建脚本流程，或者在进行编译时执行依赖模块的 pre-build 和 post-build 流程 check, tree, update, publish：仅支持运行对应模块的 pre 和 post 构建脚本流程 clean：仅支持运行对应模块的 pre 构建脚本流程 在执行这些命令时，若配置了 --skip-script 选项，则会跳过所有构建脚本的编译运行，包括依赖模块的构建脚本。 构建脚本的使用说明如下： 功能函数的返回值需要满足一定要求：当功能函数执行成功时，需要返回 0；执行失败时返回除 0 以外的任意 Int64 类型变量。 build.cj 中的所有输出都将被重定向到项目目录下，路径为 build-script-cache/[target|release]/[module-name]/bin/script-log。开发者如果在功能函数中添加了一些输出内容，可在该文件中查看。 若项目根目录下不存在 build.cj，则 cjpm 将按正常流程执行；若存在 build.cj 并定义了某一命令的前后行为，则在 build.cj 编译失败或者功能函数返回值不为 0 时，即使该命令本身能够顺利执行，命令也将异常中止。 多模块场景下，被依赖模块的 build.cj 构建脚本会在编译和单元测试流程中生效。被依赖模块构建脚本中的输出同样重定向到 build-script-cache/[target|release] 下对应模块名目录中的日志文件。 例如，下面的构建脚本 build.cj 定义了 build 前后的行为： import std.os.* func stagePreBuild(): Int64 { println("PRE-BUILD") 0
} func stagePostBuild(): Int64 { println("POST-BUILD") 0
} main(): Int64 { match (getArgs()[0]) { case "pre-build" => stagePreBuild() case "post-build" => stagePostBuild() case _ => 0 }
} 则在执行 cjpm build 命令时，cjpm 将会执行 stagePreBuild 和 stagePostBuild。cjpm build 执行完成后，script-log 日志文件内会有如下输出： PRE-BUILD
POST-BUILD 构建脚本可以通过 cjpm.toml 中的 script-dependencies 字段导入依赖模块，格式同 dependencies。例如，在 cjpm.toml 中有如下配置，导入了 aoo 模块，并且 aoo 模块内有一个名为 aaa() 的方法： [script-dependencies]
aoo = { path = "./aoo" } 则可以在构建脚本中导入该依赖，使用依赖中的接口 aaa()： import std.os.*
import aoo.* func stagePreBuild(): Int64 { aaa() 0
} func stagePostBuild(): Int64 { println("POST-BUILD") 0
} main(): Int64 { match (getArgs()[0]) { case "pre-build" => stagePreBuild() case "post-build" => stagePostBuild() case _ => 0 }
} 构建脚本依赖 script-dependencies 与源码相关依赖（源码依赖项 dependencies 和测试依赖项 test-dependencies）相互独立，源码和测试代码无法使用 script-dependencies 中的依赖模块，构建脚本也无法使用 dependencies 和 test-dependencies 中的依赖模块。若需要在构建脚本和源码/测试代码中使用同一模块，需要在 script-dependencies 和 dependencies/test-dependencies 中同时配置。

